import React from 'react'

const Header = (props) => {

  return (<h1>{props.course}</h1>)
}

const Part = (props) => {
  return (
    <p>
      {props.part} {props.exercises}
    </p>
  )
}

const Content = (props) => {

  return (
    <div>
      <Part part={props.name1} exercises={props.exercises1} />
      <Part part={props.name2} exercises={props.exercises2} />
      <Part part={props.name3} exercises={props.exercises3} />
    </div>
  )

}

const Total = (props) => {

  return (

      <p>Number of exercises {props.exercises1 + props.exercises2 + props.exercises3}</p>

  )
}


const App = () => {

  const course = 'Half Stack application development'
  const parts = [
    {
    name: 'Fundamentals of React',
    exercises: 10
    },
    {
      name: 'Using props to pass data',
      exercises: 7
    },
    {
      name: 'State of a component',
      exercises: 14
    }
  ]

  return (

    <div>
      <Header course={course} />
      <Content name1={parts[1].name} exercises1={parts[1].exercises} name2={parts[2].name} exercises2={parts2.exercises} name3={part3.name} exercises3={part3.exercises} />
      <Total exercises1={parts[1].exercises} exercises2={parts[2].exercises} exercises3={parts[3].exercises} />
    </div>
  )
}

export default App
